import React from 'react';
import './App.css';

function  Header(){
  return (
      <div class="header">
          <img src="http://192.168.1.211/os_logo.png" width="400" height="100"/>
          <h3>TmaxOS Download Page</h3>
      </div>
  );
}

const navigator = [
  {
    id: 1,
    name: "Notice",
    date: "Aug 1, 2019",
    data: ["TmaxOS 5.0.17 업데이트", "TmaxOS 4.0.1 업데이트"]
  },
  {
    id: 2,
    name: "Release",
    date: "December 24, 2018",
    data: ["내역1", "내역2"]
  },
  {
    id: 3,
    name: "Download",
    data: ["TmaxOS 5.0.17", "TmaxOS 4.0.1"]
  },
  {
    id: 4,
    name: "Manual",
    data: ["Installer Guide", "User Guide", "Printer Guide"]
  },
  {
    id: 5,
    name: "Utility",
    data: ["한글2014", "Rufus 2.11"]
  },
  {
    id: 6,
    name: "Links",
    data: ["PDF 변환", "이미지 편집", "압축 풀기"]
  }
];

function Topnav({ name }){

  return (
      <a href={`#${name}`}>{name}</a>
  );
}

function Card({ name, date, data }){

  return (
    <div className="card">
      <h2 id={name}><font color="#0066ff">&#9483; </font>{name}</h2>
      <h5>{date}</h5>
      <table>
        <tr>
          <td class="row-title">
            <strong>&#x2611; 
              {data}
            </strong>
          </td>
        </tr>
      </table>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <Header />
      <div className="topnav">
        {navigator.map(nav => (
          <Topnav name={nav.name} />
        ))}
      </div>
      <div className="leftcolum">
        {navigator.map(nav => (
          <Card id={nav.id} name={nav.name} date={nav.date} data={nav.data} />
        ))}
      </div>
    </div>
  );
}

export default App;
